var Syana = {};

$(window).load(function ()
{
  $("body").toggleClass("loaded");

  $(".animate").bind("inview", function (event, isInView)
  {
    if (isInView) {
      var animate = $(this).attr("data-animation");
      var speedDuration = $(this).attr("data-duration");
      var $t = $(this);

      setTimeout(
        function ()
        {
          $t.addClass(animate + " animated");
        },

        speedDuration
      );
    }

    /* else {
    var $t = $(this);
    var animate = $(this).attr('data-animation');

    $t.removeClass(animate + ' animated');

}
*/
  });
});
Syana.password = function ()
{
  $(".toggle-password").click(function ()
  {

    var input = $($(this).attr("toggle"));
    if (input.attr("type") == "password") {
      input.attr("type", "text");
    } else {
      input.attr("type", "password");
    }
  });
}
Syana.dropzone = function ()
{
  $(".dropzone").each(function ()
  {
    $(this).click(function ()
    {
      var el = $(this).attr('id');
      if (el === "#commercial") {
        var myDrop = new Dropzone("#commercial", {
          url: '/admin/media',
          dictDefaultMessage: "Upload here"
        });
      }
      if (el === "#identity") {
        var myDrop3 = new Dropzone("#identity", {
          url: '/admin/media',
          dictDefaultMessage: "Upload here"
        });
      }
      if (el === "#auth") {
        var myDrop2 = new Dropzone("#auth", {
          url: '/admin/media',
          dictDefaultMessage: "Upload here"
        });
      }
    });
  });


}

Syana.partners = function ()
{
  if ($("body").hasClass("rtl")) {
    $(".partners-slider").slick({
      slidesToShow: 5,
      autoplay: true,
      rtl: true,
      arrows: false,

    });
  } else {
    $(".partners-slider").slick({
      slidesToShow: 5,
      autoplay: true,
      rtl: false,
      arrows: false,

    });
  }


};
Syana.wow = function ()
{
  var wow = new WOW({
    boxClass: "wow", // animated element css class (default is wow)
    animateClass: "animated", // animation css class (default is animated)
    offset: 0, // distance to the element when triggering the animation (default is 0)
    mobile: true, // trigger animations on mobile devices (default is true)
    live: true, // act on asynchronously loaded content (default is true)
    callback: function (box)
    {
      // the callback is fired every time an animation is started
      // the argument that is passed in is the DOM node being animated
    },
    scrollContainer: null, // optional scroll container selector, otherwise use window,
    resetAnimation: true, // reset animation on end (default is true)
  });
  var current = 0;
  $(".list-categories li").each(function ()
  {
    $(this).addClass("wow fadeIn").attr({ "data-wow-duration": ".8s", "data-wow-delay": current + "s" });
    current = current + .4;
  });
  wow.init();
};

Syana.sidemenu = function ()
{
  $(".ico-sidemenu").click(function ()
  {
    $(".menu").toggleClass("active");
    $(".overlay").toggleClass("active");
  });
};

Syana.customers = function ()
{
  var slider = $(".slider-customers").lightSlider({
    item: 1,
    mode: 'fade',
    pager: false,
    controls: false,
    responsive: [
      {
        breakpoint: 480,
        settings: {
          item: 2,
          slideMove: 1,
        },
      },
    ],
  });
  $(".items-customers .lSPrev").click(function ()
  {
    slider.goToPrevSlide();

  });
  $(".items-customers .lSNext").click(function ()
  {
    slider.goToNextSlide();

  });



};


Syana.initialize = function ()
{
  Syana.password();
  Syana.dropzone();
  Syana.partners();
  Syana.wow();
  Syana.sidemenu();
  Syana.customers();
};

jQuery(document).ready(function ()
{
  Syana.initialize();
});
